import "./Navbar.css"

export const Content = () => {
    const contentArray = [
        { H1: " .NET ", H2: "DevCraft", description: "This is the first item" , color:"green"},
        { H1: " HTML ", H2: "NativeScript", description: "This is the first item" , color:"blue"},
        { H1: " NATIVE MOBILE ", H2: "Kendo UI", description: "This is the first item" , color:"red"},
    ];
    
    const contentArray2 = [
    { H1: " CMS ", H2: "Progress Sitefinity", description: "This is the first item" , color:"gray"},
    { H1: " MOBILE ", H2: "Telerik Platform", description: "This is the first item" , color:"gray"},
    { H1: " TESTING ", H2: "Test Studio", description: "This is the first item" , color:"gray"},
    ]

  return (
    <div className="m-10">
    <div className="Container">
            {contentArray.map(item => (
                <div className="bordered-div">
                <pre className=" pp text-${item.color}" style={{ color: item.color }}> {item.H1} </pre>
                <p className="self-center">{item.H2}</p>
                <p className="bold">{item.description}</p>
                <button className="border-2 p-1 rounded text-white" style={{ background: item.color}}>Learn more</button>
                </div>
            ))}
        </div>
        <div className="Container">
        {contentArray2.map(item => (
            <div className="bordered-div">
            <span className="text-${item.color}"> {item.H1} </span>
            </div>
        ))}
    </div>
    </div>
  )
}

export default Content;
